from .base import Basefrom django.db import modelsclass Cuenta(Base):    ncta_cuen=models.CharField    ('Numero de Cuenta',    max_length=20, null=True, blank=True, default='')    fape_cuen=models.DateField    ('Fecha de Apertura')    tipo_cuen=models.CharField    ('Tipo de Cuenta',    max_length=1, null=True, blank=True, default='')    codi_banc = models.ForeignKey(        'Banco',        on_delete=models.CASCADE,        related_name='Banco',    )    class Meta:        ordering = ['ncta_cuen']        indexes  = [models.Index(fields=['id',])]         db_table = u'"comun\".\"cuenta"'